import React from 'react';
import './App.css';

function Fall() {
  return (
    <div>
        <h1 className="header">Fall</h1>
        <body className="gallery">
        
     <a href="/public/img/Fall/1.jpg" class="image">
       <img src="img/Fall/1.jpg" alt=""></img>
     </a>

     <a href="/public/img/Fall/2.jpg" class="image">
       <img src="img/Fall/2.jpg" alt=""></img>
     </a>

     <a href="/public/img/Fall/3.jpg" class="image">
       <img src="img/Fall/3.jpg" alt=""></img>
     </a>

    

 


 </body>

    
    </div>
  );
}

export default Fall;
